import React from "react";
import Card from "./Card";

const CardList = ({ memes }) => {
  const cardArray = memes.map((user, i) => {
    return (
      <Card
        id={memes[i].id}
        img={memes[i].img}
        name={memes[i].name}
        email={memes[i].email}
      />
    );
  });

  return <div>{cardArray}</div>;
};
export default CardList;
